            cmds.rowLayout(
                p,
                parent=root,
                numberOfColumns=4,
                columnAlign4=('right','left','right','right'),
                columnAttach4=('both','both','both','right'),
                columnWidth4=(width,width,width*1.7,width/1.8),
                columnOffset4=(0,0,0,0)
            )
